import logo from './logo.svg';
import React from 'react'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <p>Form Testing</p>
        <form action={"lobassi@ucsc.edu"} method="POST" encType='multipart/form-data' name="EmailForm" >
          Name: <br/>
          <input type="text" size={"19"} name="ContactName"><br /></input>
          Message: <br />
          <textarea name='ContactComment' rows={"6"} cols={"20"} />
          <input type={"submit"} value="Submit" />
        </form>
      </header>
    </div>
  );
}

export default App;
